import React from "react";
import ListGroup from "react-bootstrap/ListGroup";

function DefaultExample() {
  return (
    <div
      className="background"
      style={{
        boxShadow: "10px 4px 5px -5px rgba(165,165,165,0.75);",
        width: "250px",
        marginLeft: "70px",
        height: "270px",
        border: "3px 5px 10px  black",
      }}
    >
      <br />
      <p
        style={{
          fontWeight: "bold",
          marginLeft: "10px",
          marginTop: "-10px",
          color: "black",
        }}
      >
        Progres
      </p>
      <div style={{ marginTop: "-15px" }}>
        <span style={{ marginLeft: "10px", color: "black" }}>0%</span>
        <br />
        <progress style={{ marginLeft: "10px" }}></progress>
      </div>
      <hr style={{ color: "black" }} />
      <p style={{ marginTop: "-15px", color: "black", marginLeft: "10px" }}>
        Modul 1
      </p>
      <hr style={{ marginTop: "-15px", color: "black" }} />
      <br />
      <div style={{ width: "190px", marginLeft: "35px", paddingTop: "20px" }}>
        <ListGroup>
          <ListGroup.Item>Cras justo odio</ListGroup.Item>
          <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
          <ListGroup.Item>Morbi leo risus</ListGroup.Item>
          <ListGroup.Item>Porta ac consectetur ac</ListGroup.Item>
          <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
        </ListGroup>
      </div>
    </div>
  );
}

const ProgresMateri = () => {
  return (
    <div>
      <h1>Progress Materi</h1>
      <DefaultExample />
    </div>
  );
};

export default ProgresMateri;
